import React from 'react'

export const ColumnFilter = ({column}) => {
    const { filterValue, setFilter } = column
  return (
    
        <span>
            <input value={filterValue || ''} onChange={e=>setFilter(e.target.value)} placeholder="Поиск" className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 mb-3 leading-tight focus:outline-none focus:shadow-outline"/>
        </span>
    
  )
}
